import React from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

function Admin() {
  return (
    <div className='container'>
    <Box
      component="form"
      sx={{
        // m: "auto", width: '45ch',p:"15px" ,
        '& > :not(style)': { display:"flex",justifyContent:"center",marginBottom:"30px",color:"red"},
        
      }}
      
      noValidate
      autoComplete="off"
    >
     <h4>fill product details</h4>
      <TextField id="filled-basic" name="rname" label="Restaurant name" variant="filled"  InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="imgdata" label="image address" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="address"  variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="delimg" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="somedata" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      {/* <TextField id="filled-basic" label="somedata" variant="filled" /> */}
      <TextField id="filled-basic" name="rating" variant="filled" InputLabelProps={{style: { color: 'red' }}}/>
      <TextField id="filled-basic" name="arrimg" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
    </Box>
    </div>
  )
}

export default Admin
